import React from 'react';
import logo from './logo.svg';
import './App.css';
import Title from'./title'
import Unittype from'./unittype'
import firtunit from'./firstInput'

function App() {
  return (
      <body>
        <div className = "box">
        <Title></Title>
          <Unittype></Unittype>
          <firtunit></firtunit>
        </div>
      </body>
  );
}

export default App;
